import { TestBed } from '@angular/core/testing';

import { ImageService } from './image.service';


describe('ImageService', () => {
  const service = new ImageService();
  beforeEach(() => TestBed.configureTestingModule({}));

  it('should be created', () => {
    expect(service).toBeTruthy();
  });
  describe('GetBase64WithPNG', () => {
    it('rejects with error', async () => {
      const want = new Error('The input file should not be null.');
      let have: Error;
      try {
        await service.getBase64(null);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });

    it('rejects with error', async () => {
      const want = new Error('The width should be positive, but it was: -1');
      let have: Error;
      try {
        await service.getBase64(new File(['test'], 'test.jpg'), -1);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });

    it('rejects with error', async () => {
      const want = new Error('The height should be positive, but it was: -1');
      let have: Error;
      try {
        await service.getBase64(new File(['test'], 'test.jpg'), 0, -1);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });

    it('rejects with error', async () => {
      const want = new Error('The quality sould be between 0 and 1, but it was: -1');
      let have: Error;
      try {
        await service.getBase64(new File(['test'], 'test.jpg'), 0, 0, -1);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });

    it('rejects with error', async () => {
      const want = new Error('The quality sould be between 0 and 1, but it was: 2');
      let have: Error;
      try {
        await service.getBase64(new File(['test'], 'test.jpg'), 0, 0, 2);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });
    it('encodes an image', async () => {
      const file = await fetch('https://i.imgur.com/7fdGBkp.png')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.png', { type: 'png'}));

      const res = await service.getBase64( file );

      // tslint:disable-next-line: max-line-length
      const want = 'data:image/png;base64,';
      expect(res).toEqual(want);
    });
    it('resizes an image(down)', async () => {
      const file = await fetch('https://i.imgur.com/7fdGBkp.png')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file, 100, 100, 0.75);
      expect(file.size > res.length).toEqual(true);
      const img = new Image();
      img.src = res;
      expect(file.size > res.length).toEqual(true);
      img.onload = () => {
        expect(img.width).toEqual(100);
        expect(img.height).toEqual(100);
      };
    });
    it('resizes an image(up)', async () => {
      const file = await fetch('https://i.imgur.com/7fdGBkp.png')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file, 700, 700, 1);
      const img = new Image();
      img.src = res;
      expect(file.size < res.length).toEqual(true);
      img.onload = () => {
        expect(img.width).toEqual(700);
        expect(img.height).toEqual(700);
      };
    });
  });
  describe('GetBase64WithJPG', () => {

    it('encodes an image', async () => {
      const file = await fetch('https://i.imgur.com/gNue8Za.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file );

      // tslint:disable-next-line: max-line-length
      const want = 'data:image/jpeg;base64,';
      expect(want).toEqual(res);
    });

    it('encodes an image', async () => {
      const file = await fetch('https://i.imgur.com/USnhqPI.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file );

      // tslint:disable-next-line: max-line-length
      const want = 'data:image/jpeg;base64,';
      expect(want).toEqual(res);
    });
    it('resizes an image(down)', async () => {
      const file = await fetch('https://i.imgur.com/gNue8Za.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file, 200, 200, 0.75);
      const img = new Image();
      img.src = res;
      expect(file.size > res.length).toEqual(true);
      img.onload = () => {
        expect(img.width).toEqual(200);
        expect(img.height).toEqual(200);
      };
    });
    it('resizes an image(up)', async () => {
      const file = await fetch('https://i.imgur.com/gNue8Za.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file, 700, 700, 1);
      const img = new Image();
      img.src = res;
      expect(file.size < res.length).toEqual(true);
      img.onload = () => {
        expect(img.width).toEqual(700);
        expect(img.height).toEqual(700);
      };
    });
  });
});
